import logo from './logo.svg';
import './App.css';

function App() {
  function onchange()
  {
    const a=["1","2","3"];
    const b=Math.floor(Math.random(a*3));
    return b;
  }
  return (
   <div>
    <p>Travel{onchange}</p>
   </div>
  );
}

export default App;
